import React from "react";
import "../../../component/button/button.css";

const Modal = ({ children, onClose }) => {
    return (
        <div className="modal-overlay">
            <div className="modal-content">
                <span className="button" onClick={onClose}>
                    &times;
                </span>
                {children}
            </div>
        </div>
    );
};

export default Modal;
